import './Post.css'

function Post({ id, title, body, userId }) {
    return (
        <li className="Post1">
            <span>User id: {id}</span>
            <h2>{title}</h2>
            <p>{body}</p>
            <span>Post id: {userId}</span>
        </li>
    )
}

export default Post
